  KEY `product_id_index` (`product_id`) USING BTREE,
  KEY `area_id_index` (`area_id`) USING BTREE,
  KEY `department_id_index` (`depart_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='案件池';

