  `has_leave_days` int(3) DEFAULT NULL COMMENT '已留案天数',
  `case_mark` int(10) DEFAULT NULL COMMENT '打标标记（0-	无\r\n            1-	红色\r\n            2-	蓝色\r\n            3-	黄色\r\n            ）',
  `follow_up_num` int(4) DEFAULT NULL COMMENT '案件流转次数',
  `case_follow_in_time` datetime DEFAULT NULL COMMENT '流入时间',
