  `principal_id` varchar(64) DEFAULT NULL COMMENT '委托方ID',
  `collection_status` int(4) DEFAULT NULL COMMENT '催收状态',
  `order_id` varchar(150) DEFAULT NULL COMMENT '订单ID',
  `delegation_date` date DEFAULT NULL COMMENT '委案日期',
  `close_date` date DEFAULT NULL COMMENT '结案日期',
  `commission_rate` decimal(8,4) DEFAULT NULL COMMENT '佣金比例',
  `hand_number` int(4) DEFAULT NULL COMMENT '案件手数',
  `loan_date` datetime DEFAULT NULL COMMENT '贷款日期',
  `overdue_manage_fee` decimal(18,4) DEFAULT NULL COMMENT '逾期管理费',
  `hand_up_flag` int(4) DEFAULT NULL COMMENT '挂起标识',
  `derate_amt` decimal(18,4) DEFAULT NULL COMMENT '减免金额',
  `real_pay_amount` decimal(18,4) DEFAULT NULL COMMENT '实际还款金额',
  `early_settle_amt` decimal(18,4) DEFAULT NULL COMMENT '提前结清金额',
  `early_real_settle_amt` decimal(18,4) DEFAULT NULL COMMENT '提前结清实际还款金额',
  `early_derate_amt` decimal(18,4) DEFAULT NULL COMMENT '提前结清减免金额',
  `other_amt` decimal(18,4) DEFAULT NULL COMMENT '其他金额',
  `score` decimal(5,2) DEFAULT NULL COMMENT '案件评分',
  `operator` varchar(64) DEFAULT NULL COMMENT '操作员',
  `operator_time` datetime DEFAULT NULL COMMENT '操作时间',
  `company_code` varchar(64) DEFAULT NULL COMMENT '公司code码',
  `end_remark` varchar(500) DEFAULT NULL COMMENT '结案说明',
  `followup_time` datetime DEFAULT NULL COMMENT '最新跟进时间',
  `followup_back` int(4) DEFAULT NULL COMMENT '催收反馈',
  `promise_amt` decimal(18,4) DEFAULT NULL COMMENT '承诺还款金额',
  `promise_time` datetime DEFAULT NULL COMMENT '承诺还款日期',
  `end_type` int(4) DEFAULT NULL COMMENT '结案方式',
  `credit_amount` decimal(18,4) DEFAULT NULL COMMENT '授信金额',
  `circulation_status` int(4) DEFAULT NULL COMMENT '小流转审批状态',
  `memo` varchar(1000) DEFAULT NULL COMMENT '导入案件时的备注',
  `first_pay_date` date DEFAULT NULL COMMENT '首次还款日期',
  `account_age` varchar(64) DEFAULT NULL COMMENT '账龄',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_index` (`id`) USING BTREE,
  KEY `personal_id_index` (`personal_id`) USING BTREE,
  KEY `department_id_index` (`depart_id`) USING BTREE,
  KEY `area_id_index` (`area_id`) USING BTREE,
  KEY `product_id_index` (`product_id`) USING BTREE,
  KEY `lately_id_index` (`lately_collector`) USING BTREE,
  KEY `current_id_index` (`current_collector`) USING BTREE,
  KEY `assist_id_index` (`assist_collector`) USING BTREE,
  KEY `principal_id_index` (`principal_id`) USING BTREE,
  KEY `operator_id_index` (`operator`) USING BTREE,
  KEY `case_id_index` (`case_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='案件池';

