-- ----------------------------
-- Table structure for sms_report
-- ----------------------------
DROP TABLE IF EXISTS `sms_report`;
CREATE TABLE `sms_report` (
  `id` varchar(64) NOT NULL COMMENT '主键ID',
  `dept_code` varchar(64) DEFAULT NULL COMMENT '本部门code码',
  `dept_name` varchar(200) DEFAULT NULL COMMENT '本部门名称·',
  `parent_dept_code` varchar(64) DEFAULT NULL COMMENT '上级部门code码',
  `parent_dept_name` varchar(200) DEFAULT NULL COMMENT '上级部门名称',
  `user_name` varchar(64) DEFAULT NULL COMMENT '用户名',
  `real_name` varchar(200) DEFAULT NULL COMMENT '用户姓名',
  `rank` int(4) DEFAULT NULL COMMENT '排名',
  `sms_num` int(10) DEFAULT NULL COMMENT '发送短信数量',
  `now_date` datetime DEFAULT NULL COMMENT '当前日期',
  `operator_user_name` varchar(64) DEFAULT NULL COMMENT '操作人',
  `operator_real_name` varchar(200) DEFAULT NULL COMMENT '操作人姓名',
  `operator_date` datetime DEFAULT NULL COMMENT '操作时间',
  `company_code` varchar(64) DEFAULT NULL COMMENT '公司code码',
  `success_num` int(10) DEFAULT NULL COMMENT '发送成功数量',
  `failure_num` int(10) DEFAULT NULL COMMENT '发送失败数量',
