  `id` varchar(64) NOT NULL COMMENT '系统参数的id',
  `company_code` varchar(64) DEFAULT NULL COMMENT '公司的特定标识',
  `code` varchar(200) DEFAULT NULL COMMENT '参数的自定义code',
  `name` varchar(200) DEFAULT NULL COMMENT '参数名称',
  `status` int(4) DEFAULT NULL COMMENT '参数是否启用（0是启用 1 是停用）',
  `type` varchar(200) DEFAULT NULL COMMENT '参数类型（服务的端口号）',
  `value` varchar(200) DEFAULT NULL COMMENT '参数值',
  `sign` int(4) DEFAULT NULL COMMENT '标识（0是可以修改 1是不能修改）',
  `operator` varchar(200) DEFAULT NULL COMMENT '创建人',
  `operate_time` datetime DEFAULT NULL COMMENT '创建时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '参数说明',
  `field` varchar(200) DEFAULT NULL COMMENT '备用字段(目前已被占用，修改密码加密前的值）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='常用的系统参数';

