-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` varchar(64) NOT NULL COMMENT '用户的主键id',
  `company_code` varchar(64) DEFAULT NULL COMMENT '特定公司的标识',
  `type` int(4) DEFAULT NULL COMMENT '用户的催收类型（1.电话 2.外访3.修复...)',
  `login_type` int(4) DEFAULT NULL COMMENT '用户采用的登录方式（1密码登录 2.二维码登录..)',
  `login_device` int(4) DEFAULT NULL COMMENT '用户的登录设备限制（1.pc登录 2.手机登录）',
  `login_address` varchar(64) DEFAULT NULL COMMENT '用户的最后一次登录地址（登录地址改变给出提醒）',
  `password_invalid_time` datetime DEFAULT NULL COMMENT '密码的定时修改（比如3个月后提醒修改密码）',
  `dept_id` varchar(64) DEFAULT NULL COMMENT '用户所在部门的id',
  `call_phone` varchar(64) DEFAULT NULL COMMENT '电话呼叫绑定的电话号码',
  `message_push_id` varchar(64) DEFAULT NULL COMMENT '用户绑定的消息推送的注册标识',
  `manager` int(4) DEFAULT NULL COMMENT '是否具有查看下级用户的权限',
  `user_name` varbinary(200) DEFAULT NULL COMMENT '用户名',
  `real_name` varchar(200) DEFAULT NULL COMMENT '姓名',
  `password` varchar(200) DEFAULT NULL COMMENT '密码',
  `sex` int(4) DEFAULT NULL COMMENT '性别',
  `phone` varchar(64) DEFAULT NULL COMMENT '电话',
  `email` varchar(64) DEFAULT NULL COMMENT '邮箱',
  `status` int(4) DEFAULT NULL COMMENT '状态(0-启用，1-停用)',
  `signature` varchar(200) DEFAULT NULL COMMENT '签名',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `photo` varchar(200) DEFAULT NULL COMMENT '用户头像的地址',
  `operator` varchar(200) DEFAULT NULL COMMENT '创建人用户名',
  `operate_time` datetime DEFAULT NULL COMMENT '创建时间',
  `field` varchar(200) DEFAULT NULL COMMENT '备用字段',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_index` (`id`),
  KEY `department_id_index` (`dept_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户信息管理';

-- ----------------------------
-- Records of user
