-- ----------------------------
-- Function structure for next_seq
-- ----------------------------
DROP FUNCTION IF EXISTS `next_seq`;
DELIMITER ;;
CREATE DEFINER=`pangolin`@`%` FUNCTION `next_seq`(seq_name varchar(64),seqLength INT) RETURNS varchar(10) CHARSET utf8
BEGIN
	declare current integer;
    set current = 0;
    select t.current_seq into current from batch_seq t where t.seq_name =seq_name for update;
    update batch_seq t set t.current_seq = t.current_seq + 1 where t.seq_name = seq_name;
    set current = current + 1;
		/*如果批次号超出限制,产生一个错误*/  
        IF seq_name ='orderSeq' && current >999 THEN   
            SIGNAL SQLSTATE 'HY000' SET MESSAGE_TEXT = "今日批次号已到上限";
        END IF; 
				/*如果案件号超出限制,产生一个错误*/  
        IF seq_name ='caseSeq' && current >99999 THEN   
            SIGNAL SQLSTATE 'HY000' SET MESSAGE_TEXT = "今日案件编号已到上限";
        END IF; 
				/*如果案件号超出限制,产生一个错误*/  
        IF seq_name ='prinSeq' && current >999 THEN   
            SIGNAL SQLSTATE 'HY000' SET MESSAGE_TEXT = "委托方编号已到上限";
        END IF;
	return LPAD(current,seqLength,'0');
END
;;
DELIMITER ;
